            "roomId": "12fhi23",
            "turnId": 6
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 7
        }, {
            "uniqueNumber": "A2",
            "name": "אברהם שלום",
            "roomId": "12fhi23",
            "turnId": 8
        },
        {
            "uniqueNumber": "B1",
            "name": "מרים כהן",
            "roomId": "12fhi23",
            "turnId": 9
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 10
        }
    ];

    return (
        <div className=' queuesPatientsDisplay'>
             <div className='patientsTable'>
                <div className='scrollListQueue'>
                    <table>
                        <thead>
                            <tr >
                                <th> שם מטופל</th>
                                <th>מספר</th>
                            </tr>
                        </thead>
                        <tbody>
                            {sampleData.map(item => (
                                <tr key={item.turnId}>
                                    <td>{item.name} </td>
                                    <td>{item.uniqueNumber}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>

            </div>

        </div>
    );
};

export default  QueuesPatientsDisplay;
